import React from 'react'
import Logo from '../../assets/Yogurt.svg'
import { Container } from './styles'
import ThemeProvider from '@mui/material/styles/ThemeProvider';
import createTheme from '@mui/material/styles/createTheme';


import SearchIcon from '@mui/icons-material/Search';
import ForumIcon from '@mui/icons-material/Forum';
import NotificationsActiveOutlinedIcon from '@mui/icons-material/NotificationsActiveOutlined';
import AccountCircleSharpIcon from '@mui/icons-material/AccountCircleSharp';
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';






const theme = createTheme({
  palette: {
    primary: {
      // Purple and green play nicely together.
      main: '#green',
    },
    secondary: {
      // This is green.A700 as hex.
      main: '#black',
    },
  },
});





const Header = () => {
  console.log(SearchIcon);
  return (


    <Container>
      <div className="header">

        <a href="#home">
          <img src={Logo} alt="Logo Yogurt" className="logo" />
        </a>
        <nav className="nav" theme={theme}>
            <a href="#search" className="searchLink">
            

              <SearchIcon fontSize="large" alt="search" className="SVG" id="searchSVG"></SearchIcon>
              

            </a>
            <a href="#messages" className="messageLink">
              <ForumIcon alt="messages" className="SVG" id="messageSVG"></ForumIcon>
            </a>
            <a href="#notifications" className="notifyLink">
              <NotificationsActiveOutlinedIcon alt="notifications" className="SVG" id="notifySVG"></NotificationsActiveOutlinedIcon>
            </a>
            <a href="#profile" className="userLink">
              <AccountCircleSharpIcon alt="profile" className="SVG" id="userSVG"></AccountCircleSharpIcon>
            </a>
            <a href="#more" className="moreLink">
              <MoreHorizIcon alt="more" className="SVG" id="moreSVG"></MoreHorizIcon>
            </a>
        </nav>
      </div>
    </Container>
  )
}
export default Header
